import React, { Component } from 'react'

export default class Profile extends Component {
  constructor(props) {
    super(props)
    this.state = {}

  }
  render() {
    return (
      <div>
        <h1>Bienvenido </h1>
        <h2>Add a new client:</h2>
        <input type="text" name="clientName" value={this.state.client} onChange={e => this.handleChange(e)} />
        <button onClick={this.props.logout}>Logout</button>
      </div>
    )
  }
}
